import React from 'react';
import { PolarChart, PolarAngleAxis, Radar, Tooltip } from 'recharts';

const WindRose = () => {
  const data = [
    { skill: 'Skill A', value: 120 },
    { skill: 'Skill B', value: 98 },
    { skill: 'Skill C', value: 86 },
    { skill: 'Skill D', value: 99 },
    { skill: 'Skill E', value: 100 },
    { skill: 'Skill F', value: 85 },
  ];

  return (
    <div>
      <h2>Wind Rose of Skills</h2>
      <PolarChart width={500} height={500} cx="50%" cy="50%" outerRadius="80%">
        <PolarAngleAxis dataKey="skill" />
        <Radar name="Skills" dataKey="value" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6} />
        <Tooltip />
      </PolarChart>
    </div>
  );
};

export default WindRose;
